import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend,
} from 'chart.js';
import { useEffect, useState } from 'react';
import { Bar, Pie } from 'react-chartjs-2';

ChartJS.register(
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend
);

interface graphInterface {
    FEATURE: number[],
    DEFECT: number[],
    ENHANCEMENT: number[],
    STABILIZATION: number[],
    SECURITY: number[],
    name: string
}

interface graphVisuals {
    labels: string[],
    datasets: {}
}
export async function WorkBreakdown() {

    const dta = [4, 5, 6]
    const [graph, setGraph] = useState<graphInterface[]>()
    const rawData: graphInterface[] = await fetch('http://127.0.0.1:8000/breakdown')
        .then(response => response.json())
        .then(d => d)

    setGraph(rawData)
    const [data, setData] = useState({
        labels: graph.map(point => point.name),
        datasets: [{
            label: ' Average Velocity',
            data: graph.map(item => item.FEATURE[1]),
            backgroundColor: [
                'rgb(153, 102, 255)'
            ],
            borderColor: [
                'rgb(153, 102, 0)'
            ],
            borderWidth: 1,
        }]
    });
    return <Bar data={data} />;
}
